@zedub.zed_cmd(
    pattern="╪│╪к┘К┘Г╪▒ ?(?:(.*?) ?; )?([\\s\\S]*)",
    command=("╪│╪к┘К┘Г╪▒", plugin_category),
    info={
        "header": "╪к╪н┘И┘К┘Д ╪з┘Д┘Ж╪╡ ┘Д┘Е┘Д╪╡┘В",
        "╪з┘Д╪з╪│╪к╪о┘А╪п╪з┘Е": [
            "{tr}╪│╪к┘К┘Г╪▒ + ┘Ж╪╡",
            "{tr}stcr <font file name> ; <text>",
        ],
        "┘Е╪л┘А┘А╪з┘Д": "{tr}╪│╪к┘К┘Г╪▒ hello",
    },
)
async def sticklet(event):
    "╪к╪н┘И┘К┘Д ╪з┘Д┘Ж╪╡ ┘Д┘Е┘Д╪╡┘В"
    R = random.randint(0, 256)
    G = random.randint(0, 256)
    B = random.randint(0, 256)
    reply_to_id = await reply_id(event)
    font_file_name = event.pattern_match.group(1)
    if not font_file_name:
        font_file_name = ""
    sticktext = event.pattern_match.group(2)
    reply_message = await event.get_reply_message()
    if not sticktext:
        if event.reply_to_msg_id:
            sticktext = reply_message.message
        else:
            return await edit_or_reply(event, "╪Я!")
    await event.delete()
    sticktext = deEmojify(sticktext)
    sticktext = textwrap.wrap(sticktext, width=10)
    sticktext = "\n".join(sticktext)
    image = Image.new("RGBA", (512, 512), (255, 255, 255, 0))
    draw = ImageDraw.Draw(image)
    fontsize = 230
    FONT_FILE = await get_font_file(event.client, "@T_Taiz", font_file_name)
    font = ImageFont.truetype(FONT_FILE, size=fontsize)
    while draw.multiline_textsize(sticktext, font=font) > (512, 512):
        fontsize -= 3
        font = ImageFont.truetype(FONT_FILE, size=fontsize)
    width, height = draw.multiline_textsize(sticktext, font=font)
    draw.multiline_text(
        ((512 - width) / 2, (512 - height) / 2), sticktext, font=font, fill=(R, G, B)
    )
    image_stream = io.BytesIO()
    image_stream.name = "zedub.webp"
    image.save(image_stream, "WebP")
    image_stream.seek(0)
    # finally, reply the sticker
    await event.client.send_file(
        event.chat_id,
        image_stream,
        caption="cat's Sticklet",
        reply_to=reply_to_id,
    )
    try:
        os.remove(FONT_FILE)
    except BaseException:
        pass


